import React from "react";
import SignUp from "./SignUp";
import {NavLink, Link} from "react-router-dom";
import {useHistory} from "react-router-dom";

export default function LandingPage() {
    const history = useHistory();

    function handleSignUpClick() {
        history.push('/signup')
        return(
            <Link to="/signup">
             <SignUp />    
            </Link>
        )
    }
  return (
    <div className="landing-page">
      <h3>Welcome to <span className="meme-book">MemeBook</span></h3>
      <br /> <br />
      <div className="landing-signup">
        <label><small><i>Sign Up to create a new Account: </i></small></label>
        <br />
        <NavLink to="/signup" onClick={handleSignUpClick}>SignUp</NavLink>
      </div>
      <div className="landing-login">
        <label><small><i>Already have an account?: </i></small></label>
        <br />
        <NavLink to="">LogIn</NavLink>
      </div>
    </div>
  );
}
